// frontend/src/pages/Home.js
import React from 'react';
import { Container, Typography, Button } from '@mui/material';
import { Link } from 'react-router-dom';

const Home = () => {
    return (
        <Container>
            <Typography variant="h2" gutterBottom>Welcome to MemeCoin</Typography>
            <Typography variant="h5" paragraph>
                Create and share your memes with the world!
            </Typography>
            <Button variant="contained" color="primary" component={Link} to="/create-meme">
                Create Meme
            </Button>
        </Container>
    );
};

export default Home;
